import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <div>
        <Link to="/"> home </Link>
        <Link to="about"> about </Link>
        <Link to="contact"> contact </Link>
    </div>
  )
}

export default Header
